import { useState } from "react";

const Scrapper = () => {
  const cheerio = require("cheerio");
  const axios = require("axios");
  const [data, setData] = useState([]);
  const links = [];
  axios.get("https://podzial.mech.pk.edu.pl/").then((urlResponse) => {
    const $ = cheerio.load(urlResponse.data);

    $("td.l").each((i, element) => {
      links.push(element);
    });
    setData(links);
  });
  return (
    <ul>
        {data.map((read) => {
            return (
                <li>{read}</li>
            )
        })}
    </ul>
  )
};

export default Scrapper;
